import React from "react"
import ProductCard from "./ProductCard"


const ProductList = (props) => {
    console.log("props in productlist ", props)
    return (
        <table className="ui celled striped padded table">
          <tbody>
            <tr>
              <th>
                <h3 className="ui center aligned header">Name</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Sku</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Color</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Price</h3>
              </th>
            </tr>

            {localStorage.token
            ? props.products.map(product => {
                 return <ProductCard product={product} key={product.id}/>
                }) 
            : <h4> Please Log In to see your inventory</h4>
            }


</tbody>
</table>
);
};



export default ProductList






